import React from 'react';
import classes from '../scss/Auth.module.scss'
import {REGISTRATION_ROUTE} from '../utils/consts'
import 'react-phone-input-2/lib/style.css'
import InputMask from 'react-input-mask';
import PhoneInput from 'react-phone-input-2'
const Auth = () => {
    return (
        <div className={classes.Auth}>
            <h1>Авторизация</h1>
            <div className={classes['Auth__form']}>
                <form action="">
                    <input mask="99/99/9999" value={props.value} onChange={props.onChange}>
                        {(inputProps) => <MaterialInput {...inputProps} type="tel" disableUnderline />}
                    </input>
                    <input placeholder={'Введите пароль'}/>
                </form>
            </div>

            <span>Нет аккаунта?</span>
            <a href={REGISTRATION_ROUTE}>Регистрация</a>
        </div>
    );
};

export default Auth;
